import { Line } from "d3";

export interface ScatterData {
  x: number[];
  y: number[];
  mode: string;
  type: string;
  name: string;
}

export interface Bar {
  x: number[];
  y: number[];
  type: string;
}

export interface Traces {
  x: number[];
  y: number[];
  name: string;
  type: string;
}

export interface LineStyle {
  width: number,
  color: string,
};

type LineStyleOrNull = LineStyle | null;

export interface LineTraces {
  x: number[];
  y: string[];
  name: string;
  mode: string;
  line: LineStyleOrNull;
}

export interface Heatmap {
  z: number[][];
  type: string;
}

export interface Nodes {
  id: number;
  x: number;
  y: number;
  label: string;
  size: number;
  color: string;
}

export interface Edges {
  source: number;
  target: number;
  weight: number;
}

export interface MyState {
  fileNameSelected: string;
  animalNumber: string;
  radius: string;
  subject: string;
  fileNames: string[];
  animalNumbersList: string[];
  staticTrajectories: ScatterData[];
  distanceBar: Bar;
  proximityBar: Bar;
  heatMap: Heatmap;
  statePlot: Traces[];
  individualVelocities: ScatterData[];
  averageVelocities: ScatterData;
  stateTimeline: {
    data_eating: LineTraces[],
    data_moving: LineTraces[],
    data_sitting: LineTraces[]
  };
  velocity: {
    markers: ScatterData,
    lines: ScatterData
  };
  avgVelocity: {
    lines: ScatterData,
    markers: ScatterData,
    points: ScatterData
  }
  networkGraph: {
    nodes: Nodes[],
    edges: Edges[]
  },
  status: string;
  error: string;
}

